import React, { ReactElement, ReactNode } from 'react'
import './App.css'

// Conventional props
function Heading({ title }: { title: string }) {
  return <h1>{title}</h1>
}
function HeadingWithContent({
  children,
}: {
  children: ReactNode
}): ReactElement | null {
  return <h1>{children}</h1>
}

// Default props
function Container({
  heading,
  children,
}: {
  heading: ReactNode
  children: ReactNode
}): ReactElement | null {
  return <h1>{heading}</h1>
}

function App() {
  return (
    <div className='App'>
      <Heading title='Hey, you got this!' />
      <HeadingWithContent>
        You don't have to worry about anything at all my friend
      </HeadingWithContent>
    </div>
  )
}

export default App
